import React from 'react';

import Banner from './orderconfirm/banner';
import OrderDetails from './orderconfirm/orderdetails';


function OrderConfirm() {
    return (
        <react-fragment>
            <Banner />
            <OrderDetails/>
        </react-fragment>
    );
}

export default OrderConfirm;
